INSERT INTO `post` VALUES ('28', '3', 'Wisata Hutan Joyoboyo Kediri semakin diminati', '2016-10-05', '<p class=\"teks1\">Sesuai dengan surat edaran yang di terbitkan Dirjen Adminduk per tanggal 1 Oktober 2016 bahwa blagko KTP-E seluruh indonesia \" KOSONG\" dengan kondisi saat ini Dirjen mengintrusksikan kepada seluruh Dinas Kependudukan se-Indonesia untuk menerbitkan surat keterangan yang berlaku selama 6 bulan.</p>\r\n<p>&nbsp;Dengan begitu masyarakat tidak perlu was-was perihal dokumen pengganti administrasi kependudukan khususnya KTP-Elekrtonik karena dengan di terbitkannya surat keterangan tersebuit masyarakat bisa &nbsp;mengakses pelayanan lainya seperti : perbankan, kesehatan, kepolisian dan lain-lainya. Surat.keterangan tersebut berlaku sejak surat edaran di terbitkan oleh Dirjen Adminiduk</p>', '20171027_032157perpustakaan_sekolah-dps.jpg', '0', 'Kediri');
INSERT INTO `post` VALUES ('22', '3', 'Dinas Kearsipan Dan Perpustakaan', '2016-11-30', '<p><em>Dispendukcapil</em>&nbsp;| 17-04-2014</p>\r\n<p>Rabu, 16 April 2014 Kepla Dinas Kependudukan dan Pencatatan Sipil Kabupaten Banyuwangi menerima kunjungan kerja atau studi banding dari Dinas Kependudukan dan Pencatatan Sipil Kabupaten Banjar Kalimantan Selatan dalam rangka peningkatan wawasan petugas pelayanan pencatatan sipil di Kabupaten Banjar.</p>\r\n<p>Rombongan yang dipimpin oleh Drs.Eddy Fahrin selaku Kepala Bidang Pencatatan Sipil yang didampingi oleh Kasi Kelahiran dan Kematian Ibu Ristawati beserta staf &nbsp;diterima oleh Kepala Dinas Kependudukan dan Pencatatan Sipil Kabupaten Banyuwangi SUDJANI,SH yang didampingi Kabid. Pencatatan Sipil Ibu Suminten. Dalam kunjungan kerja ini dibahas mengenai masalah-masalah pelayanan&nbsp; yang ada pada Dinas Kependudukan dan Pencatatan Sipil.</p>\r\n<p>Pelayanan yang ada pada Dinas Kependudukan dan Pencatatan Sipil harus benar ditingkatkan terus menerus guna mendekatkan pelayanan kepada masyarakat dan memberikan pelayanan terbaik. Salah satu pelayanan yang memudahkan masyarakat adalah adanya pelayanan pembuatan akta kelahiran secara online. Akta kelahiran online meliputi bayi lahir di Rumah Sakit atau di Bidan dan Puskesmas pulang lansung bawa akta kelahiran. Petugas rumah sakit dan puskesmas langsung memasukkan data-data bayi dan persyaratan akta ke SIAK akta onlie dan kemudian diproses di Dispenduk, setelah jadi langsung dikirimkan lewat pos ke rumahsakit dan puskesmas tempat kelahiran bayi. Ini berlaku untuk bayi yang lahir o-2 hari, sedang untuk bayi yang lahir 3-60 hari bisa melalui kecamatan masing-masing dan akan dikirimkan lewat pos ke kecamatan. Sedang untuk yang diatas 1 tahun harus di Dinas Kependudukan dan Pencatatan Sipil. Semua dilakukan secara online sehingga pelayayan lebih cepat dan mudah.</p>\r\n<p>Kendala yang ada di Kabupaten Banjar adalah belum optimalnya jaringan SIAK di kecamatan-kecamatan dan belum ada jaringan yang di rumah sakit dan di puskesmas. Kendala ini dikarenakan wilayahnya yang luas dan ada wilayah dimana untuk menuju wilayang itu harus melalui dua kabupaten dan juga wilayah-wilayah pantai yang kurang terjaukau jaringan.</p>\r\n<p>Semoga dengan adanya kunjungan ini akan membuka wawasan bagi Dinas Kependudukan dan Pencatatan Sipil Kabupaten Banjar untuk meningkatkan pelayanan bagi masyarakat</p>', '20171027_032157perpustakaan_sekolah-dps.jpg', '0', '');
INSERT INTO `post` VALUES ('24', '3', 'Bentuk Perpustakaan untuk Tuna Netra', '2016-10-01', '<p class=\"teks1\">Seiring dengan kegiatan yang terus dilakukan oleh Dinas Kependudukan dan Pencatatan Sipil Kabupaten Malang dalam melakukan program jemput bola,bisa dilihat</p>\r\n<p>&nbsp;Antusiasme masyarakat dengam pelayanan yang di berikan oleh petugas dari Dinas Kependudukan dan Pencatatan Sipil Kabupaten Malang sangat tinggi itu dapat di lihat dari berkas masyarakat yang &nbsp;masuk rata- rata sampai dengan angka 400 pengajuan.Semoga dengan adanya kegiatan ini masyarakat dapat memanfaatkan dengan baik.</p>', '20171027_032157perpustakaan_sekolah-dps.jpg', '0', 'Kediri');
