INSERT INTO `tunggal` VALUES ('1', '2015-03-19', '<p>Visi dan Misi Dinas Pendapatan Daerah Kota Kediri</p>\n<p>Visi :<br />Terwujudnya Pengelolaan Pendapatan Daerah yang Efektif, Efisien, Transparan dan Akuntabel</p>\n<p>Misi :</p>\n<p>Untuk mewujudkan pengelolaan pendapatan dengan efektif, efisien,transparandan akuntabel dapat dicapai &nbsp;melalui misi sebagai berikut</p>\n<ol>\n<li>Meningkatkan kualitas dan profesionalisme sumberdaya manusia (SDM) aparat dan pelaksana pemungut pendapatan daerah, dengan tujuan:\n<ul>\n<li>Meningkatkan kualitas dan profesionalisme SDM Aparatur.</li>\n<li>Meningkatkan sarana dan prasarana yang memadai baik secara kuantitas dan kualitas untuk mendukung kelancaran tugas.</li>\n</ul>\n</li>\n<li>Peningkatan Pendapatan Daerah, dengan tujuan meningkatkan pendapatan daerah utamanya PAD.</li>\n</ol><noscript>activate javascript</noscript>', '1');
INSERT INTO `tunggal` VALUES ('2', '2015-03-19', '<p><strong>Tugas Pokok dan Fungsi Dinas Pendapatan</strong></p>\n<p>Sesuai dengan Peraturan Walikota Kediri Nomor 1 Tahun 2015 tentang Perubahan atas Peraturan Walikota Kediri Nomor 54 Tahun 2014 tentang Uraian Tugas Pokok dan Fungsi Dinas Pendapatan, Dinas Pendapatan mempunyai tugas melaksanakan urusan pemerintahan daerah di bidang pendapatan berdasarkan azas otonomi dan tugas pembantuan serta pengadaan barang/jasa.</p>\n<p>Untuk melaksanakan tugas tersebut, Dinas Pendapatan mempunyai fungsi :</p>\n<ol>\n<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Perumusan kebijakan teknis di bidang pendapatan;</li>\n<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Penyelenggaraan urusan pemerintahan dan pelayanan umum di bidang pendapatan;</li>\n<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pembinaan dan pelaksanaan tugas di bidang pendapatan;</li>\n<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Penyelenggaraan pengadaan barang/jasa pemerintah; dan</li>\n<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pelaksanaan tugas-tugas lain yang diberikan oleh Walikota sesuai dengan tugas dan fungsinya.</li>\n</ol>', '2');
