INSERT INTO `tunggal` VALUES ('9', '2016-09-29', '<p>PROFIL DINAS KEARSIPAN DAN PERPUSTAKAAN KOTA KEDIRI</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>Plt, Kepala Dinas Kearsipan dan Perpustakaan Kota Kediri:</p>\r\n<p>&nbsp;Dra. ENNY ENDARJATI, M.Si</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>SEKRETARIAT Dinas Kearsipan dan Perpustakaan Kota Kediri :</p>\r\n<p>AGUS SUTRISNO SH, MH</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>KEPALA BIDANG Kearsipan :</p>\r\n<p>SULAIMAN S.Pd, MM</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>KEPALA BIDANG Perpustakaan : DJATI UTOMO SH, MH</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>KEPALA BIDANG PENGEMBANGAN:</p>\r\n<p>FEBIOKE SATYA PERMANA, ST,MT</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', '10');
INSERT INTO `tunggal` VALUES ('10', '2016-09-29', '<div class=\"entry-content\">\r\n<p>Dinas Kependudukan Dan Pencatatan Sipil melaksanakan tugas pokok penyusunan dan pelaksanaan kebijakan daerah di bidang kependudukan, pencatatan sipil, dan transmigrasi.</p>\r\n<p>Dinas Kependudukan Dan Pencatatan Sipil mempunyai fungsi :</p>\r\n<ol>\r\n<li>Perumusan/pelaksanaan kebijakan teknis kependudukan pencatatan sipil;</li>\r\n<li>Penyusunan dan pelaksanaan Rencana Strategis dan Rencana Kerja Tahunan di bidang kependudukan dan pencatatan sipil;</li>\r\n<li>Pelaksanaan pendaftaran penduduk;</li>\r\n<li>Pelaksanaan pemberian Nomor Induk Kependudukan (NIK);</li>\r\n<li>Penerbitan Kartu Keluarga (KK) dan Kartu Tanda Penduduk (KTP), Kartu Tanda Penduduk Khusus;</li>\r\n<li>Pelaksanaan penerbitan dan pengelolaan dokumen catatan sipil;</li>\r\n<li>Pencatatan mutasi penduduk dan perubahan data-data penduduk;</li>\r\n<li>Pengumpulan dan pengolahan data penduduk dengan hak akses;</li>\r\n<li>Pelaksanaan dan fasilitasi transmigrasi;</li>\r\n<li>Pengelolaan sistem dan pelayanan informasi kependudukan;</li>\r\n<li>Pelaksanaan penyuluhan kependudukan dan catatan sipil;</li>\r\n<li>Pelaksanaan monitoring, evaluasi, dan pelaporan kependudukan;</li>\r\n<li>Pelaksanaan pencatatan sipil;</li>\r\n<li>Pelaksanaan kegiatan bidang pemungutan retribusi;</li>\r\n<li>Pelaksanaan administrasi umum meliputi penyusunan program, ketatalaksanaan, ketatausahaan, keuangan, kepegawaian, rumah tangga, perlengkapan, kehumasan, kepustakaan, dan kearsipan;</li>\r\n<li>Pelaksanaan Standar Pelayanan Minimal (SPM);</li>\r\n<li>Penyusunan dan pelaksanaan Standar Pelayanan Publik (SPP);</li>\r\n<li>Pelaksanaan fasilitasi pengukuran Indeks Kepuasan Masyarakat (IKM) dan/atau pelaksanaan pengumpulan pendapat pelanggan secara periodik yang bertujuan untuk memperbaiki kualitas layanan;</li>\r\n<li>Pengelolaan pengaduan masyarakat bidang kependudukan &amp; catatan sipil;</li>\r\n<li>Pemberdayaan dan pembinaan jabatan fungsional;</li>\r\n<li>Pengevaluasian dan pelaporan pelaksanaan tugas dan fungsi;</li>\r\n<li>Pelaksanaan tugas lain yang diberikan Walikota sesuai tugas dan fungsi.</li>\r\n</ol></div>', '11');
