INSERT INTO `tunggal` VALUES ('16', '2016-09-30', '<p>Adapun&nbsp;<strong>tujuan</strong>&nbsp;dari Dinas Kependudukan dan Pencatatan Sipil antara lain :</p>\r\n<ol>\r\n<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Meningkatkan pelayanan yang profesional cepat, tepat dan mudah.</li>\r\n<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Mewujudkan dan mengembangkan sistim penyelenggaraan Administrasi&nbsp;&nbsp;Kependudukan yang berbasis SIAK dengan menyiapkan alat dan perangkat yang memadai.</li>\r\n<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Mewujudkan sistem penyimpanan data dan sistem informasi dokumen dengan berbasis teknologi informasi.</li>\r\n<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Meningkatnya kualitas SDM yang mampu dalam Mewujudkan dan mengembangkan sistim penyelenggaraan Administrasi Kependudukan yang berbasis SIAK dalam memberikan pelayanan masyarakat.</li>\r\n<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Terwujudnya pranata hukum dan kelembagaan yang mendukung proses administrasi penduduk dan pencatatan sipil&nbsp;&nbsp;dalam memberikan kepastian dan perlindungan hak sipil masyarakat.</li>\r\n</ol>\r\n<p>&nbsp;Adapun&nbsp;<strong>s<em>asaran</em></strong>&nbsp;yang ingin dicapai sebagai bentuk penjabaran dari tujuan yang telah&nbsp;&nbsp;&nbsp;&nbsp;ditetapkan di atas, adalah sebagai berikut :</p>\r\n<ol>\r\n<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Tersedianya data base yang akurat dalam pelayanan informasi Administrasi kependudukan dan pencatatan sipil.</li>\r\n<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Tersedianya tenaga yang profesional dalam penanganan administrasi kependudukan dan pelayanan pencatatan sipil.</li>\r\n<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Terciptanya lembaga yang kondusif bagi terselenggaranya pelayanan administrasi kependudukan dan Pencatatan sipil yang profesional.</li>\r\n<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Terciptanya peraturan perundang-undangan yang dapat memberikan kepastian dan perlindungan sesuai hak-hak&nbsp;&nbsp;penduduk.</li>\r\n<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Terlaksananya program sosialisasi kepada masyarakat dalam rangka peningkatan kesadaran akan arti pentingnya dokumen kependudukan dan pencatatan sipil.</li>\r\n</ol>', '17');
INSERT INTO `tunggal` VALUES ('17', '2016-09-30', '<p>Visi :<strong>&nbsp;</strong></p>\r\n<p><strong>Dinas Perpustakaan dan Kearsipan Kota Kediri yang Profesional &nbsp;&amp; unggul dalam Pengelolaan Perpustakaan,dan Arsip sebagai sumber pengetahuan dan Informasi untuk mencapai Sumber Daya Manusia Kota Kediri yang Harmoni</strong></p>\r\n<p><strong>Misi:</strong></p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mewujudkan Sumber daya Manusia (SDM) yang sadar Arsip dan gemar membaaca.</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Meningkatnya akses dan kualitas pendidikan masyarakat.</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Peningkatan pelayanan Perpustakaan, Kearsipan kepada masyarakat</strong></p>\r\n<p><strong>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><strong>Peningkatan upaya dokumentasi pada usaha pembangunan Kota kediri</strong></p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>&nbsp;Menumbuhkan budaya tertib arsip</strong></p>', '18');
