INSERT INTO `tunggal` VALUES ('19', '2016-09-30', '<h1>Tugas Pokok Dispenduk</h1>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>Dinas Kependudukan Dan Pencatatan sipil melaksanakan tugas pokok penyusunan dan pelaksanaan kebijakan daerah di bidang Administrasi Kependudukan.</p>\r\n<p>Untuk melaksanakan tugas pokok dimaksud, Dinas Kependudukan Dan Pencatatan sipil mempunyai fungsi :</p>\r\n<ol>\r\n<li>Pengumpulan, Pengelolaan dan Pengendalian Data yang berbentuk Data Base serta analisis data untuk penyusunan program kegiatan;</li>\r\n<li>Perencanaan strategis pada Dinas Kependudukan dan Pencatatan sipil ;</li>\r\n<li>Perumusan Kebijakan teknis Bidang Kependudukan dan Pencatatan sipil ;</li>\r\n<li>Penyelenggaraan urusan Pemerintahan dan urusan Umum Bidang Kependudukan dan Pencatatan Sipil ;</li>\r\n<li>Pembinaan dan pelaksanaan tugas Bidang Kependudukan dan Pencatatan sipil;</li>\r\n<li>Pelaksanaan, Pengawasan, Pengendalian serta Evaluasi dan Pelaporan peyelenggaraan Bidang Kependudukan dan Pencatatan sipil ;</li>\r\n<li>Pelaksanaan standart pelayanan minimal yang wajib dilaksanakan pada Bidang Kependudukan dan Pencatatan sipil ;</li>\r\n<li>Penyelenggara Kesekretariatan Dinas Kependudukan dan Pencatatan sipil ;</li>\r\n<li>Pelayanan Pendaftaran Penduduk, Pencatatan sipil, Pengelolaan Informasi Adm Kependudukan dan Penyerasian perkembangan kependudukan;</li>\r\n<li>Pengkoordinasian Integrasi dan Sinkronisasi kegiatan Bidang Administrasi Kependudukan dan Penyerasian Perkembangan Kependudukan dilingkungan Pemerintah Daerah ;</li>\r\n<li>Pembinaan kepada masyarakat tentang Kependudukan dan Pencatatan sipil ;</li>\r\n<li>Pelaksanaan kerjasama dengan lembaga Pemeritah dan lembaga lainnya ;</li>\r\n<li>Koordinasi dengan Instansi terkait dalam hal kebijakan Kependudukan, Tertib Adminitrasi Kependudukan dan Analisis dampak Kependudukan ;</li>\r\n<li>Pelaksanaan Sistem Informasi Administrasi Kependudukan ;</li>\r\n<li>Pembangunan dan Pengembangan Jaringan Komunikasi Data Kependudukan ;</li>\r\n<li>Perlindungan Data Pribadi penduduk dalam proses dan hasil Pedaftaraan Penduduk serta Pencatatan sipil pada Data Base Kependudukan;</li>\r\n<li>Pembinaan dan pengembangan sumber daya manusia Pengelola Pendaftaran Penduduk, Pencatatan sipil, Pengelolaan Informasi Administrasi Kependudukan dan Penyerasian Perkembangan Kependudukan ;</li>\r\n<li>Pengawasan dan Pengendalian atas penyelenggaraan Pendaftaran Penduduk, Pencatatan Sipil Pengelolaan Informasi Administrasi Kependudukan dan Penyerasian Perkembangan Kependudukan</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<h1>&nbsp;</h1>', '20');
