INSERT INTO `tunggal` VALUES ('22', '2016-10-03', '<p>Demografi Kota Kediri dijelaskan dalam data jumlah penduduk, kepadatan penduduk, dan jumlah penduduk berdasarkan mata pencaharian.<br /><br /><a name=\"more\"></a>Jumlah Penduduk Kota Kediri berdasarkan kecamatan Tahun 2003-2007</p>\r\n<div class=\"separator\"><a href=\"https://4.bp.blogspot.com/-XBtmA-7bgCg/VyQ_N5Vy9oI/AAAAAAAAAR0/LIUPSPgKJfsnzA83QhDA84XW1jChzbxugCLcB/s1600/jml%2Bpenduduk.JPG\"><img src=\"https://4.bp.blogspot.com/-XBtmA-7bgCg/VyQ_N5Vy9oI/AAAAAAAAAR0/LIUPSPgKJfsnzA83QhDA84XW1jChzbxugCLcB/s320/jml%2Bpenduduk.JPG\" alt=\"\" width=\"320\" height=\"221\" border=\"0\" /></a></div>\r\n<div>&nbsp;<em>Sumber : RTRW Kota Kediri 2011-2030</em></div>\r\n<div><em>&nbsp;</em></div>\r\n<div>Kepadatan Penduduk Kota Kediri berdasarkan kecamatan Tahun 2007</div>\r\n<div class=\"separator\">&nbsp;</div>\r\n<div class=\"separator\"><a href=\"https://3.bp.blogspot.com/-4GjgV-qEiQM/VyQ_N0__KrI/AAAAAAAAAR8/Kr3BAmKAt3w544cbwU6euAlhALwUCeZYwCLcB/s1600/kepadatan%2Bpenduduk.JPG\"><img src=\"https://3.bp.blogspot.com/-4GjgV-qEiQM/VyQ_N0__KrI/AAAAAAAAAR8/Kr3BAmKAt3w544cbwU6euAlhALwUCeZYwCLcB/s320/kepadatan%2Bpenduduk.JPG\" alt=\"\" width=\"320\" height=\"181\" border=\"0\" /></a></div>\r\n<div>&nbsp;<em>Sumber : RTRW Kota Kediri 2011-2030</em></div>\r\n<div>&nbsp;</div>\r\n<div>Data jumlah penduduk dan kepadatan penduduk Kota Kediri disajikan dalam Peta Jumlah&nbsp; dan Kepadatan Penduduk Tahun 2009 berikut.</div>\r\n<div class=\"separator\"><a href=\"https://3.bp.blogspot.com/-T1CYNxfGy0g/VyRAEYGoUJI/AAAAAAAAASE/xfEu4rb7z60zwIpgpNOdZz4Sc-u3ybZqQCLcB/s1600/5.%2BJumlah%2Bdan%2BKepadatan%2BPenduduk%2BTahun%2B2008%2Bcopy.jpg\"><img src=\"https://3.bp.blogspot.com/-T1CYNxfGy0g/VyRAEYGoUJI/AAAAAAAAASE/xfEu4rb7z60zwIpgpNOdZz4Sc-u3ybZqQCLcB/s320/5.%2BJumlah%2Bdan%2BKepadatan%2BPenduduk%2BTahun%2B2008%2Bcopy.jpg\" alt=\"\" width=\"320\" height=\"226\" border=\"0\" /></a></div>\r\n<div><em>Sumber : RTRW Kota Kediri 2011-2030</em></div>\r\n<div>&nbsp;</div>\r\n<div>Data jumlah penduduk berdasarkan mata pencaharian penduduk Kota Kediri Tahun 2007 disajikan dalam diagram berikut.</div>\r\n<div class=\"separator\"><a href=\"https://4.bp.blogspot.com/-zYjarQbyyVM/VyQ_NwoCDUI/AAAAAAAAAR4/dj3x7WkK244eBuKgYkjt-Tt0ebT77ZduwCLcB/s1600/pekerjaan.JPG\"><img src=\"https://4.bp.blogspot.com/-zYjarQbyyVM/VyQ_NwoCDUI/AAAAAAAAAR4/dj3x7WkK244eBuKgYkjt-Tt0ebT77ZduwCLcB/s320/pekerjaan.JPG\" alt=\"\" width=\"320\" height=\"222\" border=\"0\" /></a></div>\r\n<div><em>Sumber : RTRW Kota Kediri 2011-2030</em></div>', '23');
